    true,nt"url": null,nt"notes": "The National Renewable Energy Laboratory
    (NREL) publishes a wide selection of data and statistics on energy power technologies
    from a variety of sources (e.g. EIA, Oak Ridge National Laboratory, Sandia National
    Laboratory, EPRI and AWEA). In 2006, NREL published the 4th edition, presenting,
    among other things, _data on the U.S. electricity supply_.  The series of datasets
    included are: primary and delivered energy (1980 - 2030); electricity overview (1980
    - 2030); consumption of fossil fuels by electric generators (1980 - 2030); electric
    power sector energy consumption (1980 - 2030); fossil fuel generation by age of
    generating unit (1980 - 2005); nuclear generation by age of generating units (1980
    - 2005); operational renewable energy generating capacity (1980 - 2003); number
    of utilities (1980 - 2004); top-10 IOUs (1990 - 2004); top-10 worldwide independent
    power producers;  and utility mergers and acquisitions (1998 - 2004). The data was
    compiled from a variety of sources, including EIA, NREL, and SEC.",nt"license_title":
